<style>
/* Embedded CSS - Abu-Abu Modern theme */
:root{--bg:#333;--ui:#ddd;--accent:#4cff4c;--enemy:#ff4c4c}
html,body{height:100%;margin:0;font-family:"Courier New",monospace;background:var(--bg);color:var(--ui);-webkit-font-smoothing:antialiased;}
.wrap{min-height:100%;display:flex;align-items:center;justify-content:center;padding:18px;box-sizing:border-box;flex-direction:column;gap:18px;}
.canvas-container{width:100%;max-width:380px;display:flex;justify-content:center;align-items:center;}
canvas{background:#444;border:3px solid var(--accent);box-shadow:0 0 10px var(--accent);image-rendering:pixelated;width:100%;height:auto;display:block;}
.screen{text-align:center;}
.hidden{display:none;}
h1,h2{color:var(--ui);text-shadow:0 0 6px var(--accent);}
button{font-family:"Courier New",monospace;font-size:16px;padding:10px 16px;margin:8px;border:2px solid var(--accent);background:#222;color:var(--accent);border-radius:8px;}
button:active{background:var(--accent);color:#111;}
#controls{display:flex;justify-content:center;gap:18px;margin-top:10px;}
.btn{width:64px;height:64px;font-size:22px;}
#homeBtn{margin-top:8px;padding:8px 14px;border:2px solid var(--enemy);color:var(--enemy);background:#111;border-radius:8px;display:none;}
.credit{margin-top:12px;color:#aaa;font-size:13px;}
@media(max-width:400px){canvas{max-height:78vh}}
</style>
</head>
<body>
<div class="wrap">

  <!-- Menu -->
  <div id="menu" class="screen">
    <h1>DODGE THE BLOCK R3TR9</h1>
    <button id="startBtn">Start Game</button>
    <button id="settingsBtn">Settings</button>
    <button id="creditsBtn">Credits</button>
    <p class="credit">Made with ❤️ by Revano</p>
  </div>

  <!-- Settings -->
  <div id="settings" class="screen hidden">
    <h2>Settings</h2>
    <div style="margin:8px 0;">
      <label>Background:</label>
      <select id="bgColor">
        <option value="#333">Gray (Default)</option>
        <option value="#000">Black</option>
        <option value="#0a0">Green</option>
      </select>
    </div>
    <div style="margin:8px 0;">
      <label>Player:</label>
      <select id="playerColor">
        <option value="#4cff4c">Green</option>
        <option value="#4c4cff">Blue</option>
        <option value="#ff4c4c">Red</option>
      </select>
    </div>
    <div style="margin:8px 0;">
      <label>Enemy Shape:</label>
      <select id="enemyShape">
        <option value="triangle">Triangle (Default)</option>
        <option disabled>Coming Soon...</option>
      </select>
    </div>
    <div style="margin-top:12px;">
      <button id="backFromSettings">Back</button>
    </div>
  </div>

  <!-- Credits -->
  <div id="credits" class="screen hidden">
    <h2>Credits</h2>
    <p style="color:#ccc">Created by Revano — Modern Gray Edition</p>
    <div style="margin-top:12px;"><button id="backFromCredits">Back</button></div>
  </div>

  <!-- Game Screen -->
  <div id="gameScreen" class="hidden">
    <div class="canvas-container">
      <canvas id="gameCanvas" width="360" height="540"></canvas>
    </div>
    <div id="controls">
      <button class="btn" id="leftBtn">◀</button>
      <button class="btn" id="rightBtn">▶</button>
    </div>
    <button id="homeBtn">Back to Home</button>
  </div>

</div>

<script>
/* Single-file JS: game logic + UI */
const menu = document.getElementById("menu");
const settings = document.getElementById("settings");
const credits = document.getElementById("credits");
const gameScreen = document.getElementById("gameScreen");
const homeBtn = document.getElementById("homeBtn");
const canvas = document.getElementById("gameCanvas");
const ctx = canvas.getContext("2d");

let settingsData = {
  bgColor: "#333",
  playerColor: "#4cff4c",
  enemyColor: "#ff4c4c",
  enemyShape: "triangle"
};

// load settings from localStorage if present
try{
  const s = JSON.parse(localStorage.getItem('dtb_settings')||'{}');
  Object.assign(settingsData, s);
}catch(e){}

document.getElementById('bgColor').value = settingsData.bgColor;
document.getElementById('playerColor').value = settingsData.playerColor;
document.getElementById('enemyShape').value = settingsData.enemyShape;

// game variables
const BASE_W = 360, BASE_H = 540;
let player, enemies, score, highScore, gameOver, moveLeft, moveRight, explosionParticles;
let powerUp = null, shieldActive = false, shieldTimer = 0;
let gameRunning = false, enemyCount = 6;

// apply visual settings
function applyUI(){
  document.body.style.background = settingsData.bgColor;
  canvas.style.background = settingsData.bgColor;
}
applyUI();

function makeEnemy(){
  return {
    x: Math.random() * (BASE_W - 40),
    y: -50 - Math.random()*200,
    w: 36, h:36,
    speed: 2 + Math.random()*2.5
  };
}

function resetGame(){
  player = { x: BASE_W/2 - 20, y: BASE_H - 70, w:40, h:40, speed:6 };
  enemies = [];
  for(let i=0;i<enemyCount;i++) enemies.push(makeEnemy());
  score = 0;
  highScore = Number(localStorage.getItem('dtb_high')||0);
  gameOver = false;
  explosionParticles = [];
  powerUp = null;
  shieldActive = false;
  shieldTimer = 0;
  homeBtn.style.display = 'none';
  gameRunning = true;
}

function playBeep(freq,dur){
  try{
    let ac = window.audioCtx || (window.audioCtx = new (window.AudioContext||window.webkitAudioContext)());
    let o = ac.createOscillator();
    let g = ac.createGain();
    o.type='square'; o.frequency.value=freq;
    o.connect(g); g.connect(ac.destination);
    g.gain.setValueAtTime(0.06, ac.currentTime);
    o.start(); o.stop(ac.currentTime + dur);
  }catch(e){}
}

function createExplosion(cx,cy){
  explosionParticles = [];
  for(let i=0;i<28;i++){
    explosionParticles.push({x:cx,y:cy,dx:(Math.random()-0.5)*6,dy:(Math.random()-0.5)*6,size:4+Math.random()*4,life:20+Math.floor(Math.random()*20)});
  }
}

function rectIntersects(a,b){
  return (a.x < b.x + b.w && a.x + a.w > b.x && a.y < b.y + b.h && a.y + a.h > b.y);
}

function update(){
  if(!gameRunning && !gameOver) return;
  if(gameOver){
    explosionParticles.forEach(p=>{p.x+=p.dx; p.y+=p.dy; p.life--;});
    explosionParticles = explosionParticles.filter(p=>p.life>0);
    return;
  }
  if(moveLeft && player.x>0) player.x -= player.speed;
  if(moveRight && player.x + player.w < BASE_W) player.x += player.speed;

  enemies.forEach(e=>{
    e.y += e.speed;
    if(e.y > BASE_H){
      e.y = -40 - Math.random()*200;
      e.x = Math.random() * (BASE_W - e.w);
      score++;
      playBeep(600,0.06);
    }
    if(!shieldActive && rectIntersects(player,e)){
      createExplosion(player.x + player.w/2, player.y + player.h/2);
      playBeep(120,0.25);
      endGame();
    } else if(shieldActive && rectIntersects(player,e)){
      e.y = -60 - Math.random()*200;
      e.x = Math.random() * (BASE_W - e.w);
    }
  });

  if(!powerUp && score !== 0 && score % 10 === 0){
    powerUp = {x: Math.random()*(BASE_W-30), y:-40, w:30, h:30, speed:3};
  }
  if(powerUp){
    powerUp.y += powerUp.speed;
    if(powerUp.y > BASE_H) powerUp = null;
    if(rectIntersects(player, powerUp)){
      shieldActive = true; shieldTimer = 300; powerUp = null; playBeep(900,0.12);
    }
  }
  if(shieldActive){ shieldTimer--; if(shieldTimer<=0) shieldActive=false; }

  if(score !== 0 && score % 20 === 0){
    enemies.forEach(e=> e.speed += 0.04);
  }
}

function drawEnemyTri(e){
  ctx.fillStyle = settingsData.enemyColor;
  ctx.beginPath();
  // triangle pointing down: top-left and top-right then bottom middle
  ctx.moveTo(e.x, e.y); // left-top
  ctx.lineTo(e.x + e.w, e.y); // right-top
  ctx.lineTo(e.x + e.w/2, e.y + e.h); // bottom middle (point down)
  ctx.closePath();
  ctx.fill();
  ctx.strokeStyle = "#000"; ctx.lineWidth = 2; ctx.stroke();
}

function drawPlayer(){
  ctx.fillStyle = settingsData.playerColor;
  ctx.fillRect(player.x, player.y, player.w, player.h);
  ctx.strokeStyle = "#000"; ctx.lineWidth = 2; ctx.strokeRect(player.x, player.y, player.w, player.h);
  if(shieldActive){
    ctx.strokeStyle = settingsData.enemyColor; ctx.lineWidth = 4;
    ctx.strokeRect(player.x - 4, player.y - 4, player.w + 8, player.h + 8);
  }
}

function draw(){
  // clear & background
  ctx.clearRect(0,0,BASE_W,BASE_H);
  ctx.fillStyle = settingsData.bgColor; ctx.fillRect(0,0,BASE_W,BASE_H);

  if(!gameOver) drawPlayer();
  enemies.forEach(e => drawEnemyTri(e));

  if(powerUp){
    ctx.fillStyle = "#44aaff"; ctx.fillRect(powerUp.x, powerUp.y, powerUp.w, powerUp.h);
    ctx.strokeStyle="#000"; ctx.lineWidth=2; ctx.strokeRect(powerUp.x, powerUp.y, powerUp.w, powerUp.h);
  }

  explosionParticles.forEach(p=>{ ctx.fillStyle = settingsData.playerColor; ctx.fillRect(p.x,p.y,p.size,p.size); });

  ctx.fillStyle = settingsData.playerColor; ctx.font = "18px Courier New";
  ctx.fillText("SCORE " + score, 10, 24);
  ctx.fillText("HIGH " + highScore, 10, 44);

  if(gameOver && explosionParticles.length === 0){
    ctx.fillStyle = settingsData.enemyColor; ctx.font = "26px Courier New";
    ctx.fillText("= GAME OVER =", BASE_W/2 - 90, BASE_H/2 - 10);
    ctx.font = "16px Courier New"; ctx.fillText("Back to Home", BASE_W/2 - 60, BASE_H/2 + 20);
  }
}

function gameLoop(){ update(); draw(); requestAnimationFrame(gameLoop); }
requestAnimationFrame(gameLoop);

// controls
moveLeft = moveRight = false;
document.getElementById('leftBtn').addEventListener('touchstart', e=>{ e.preventDefault(); moveLeft = true; });
document.getElementById('leftBtn').addEventListener('touchend', e=>{ e.preventDefault(); moveLeft = false; });
document.getElementById('rightBtn').addEventListener('touchstart', e=>{ e.preventDefault(); moveRight = true; });
document.getElementById('rightBtn').addEventListener('touchend', e=>{ e.preventDefault(); moveRight = false; });

document.addEventListener('keydown', e=>{ if(e.key==='ArrowLeft') moveLeft=true; if(e.key==='ArrowRight') moveRight=true; });
document.addEventListener('keyup', e=>{ if(e.key==='ArrowLeft') moveLeft=false; if(e.key==='ArrowRight') moveRight=false; });

homeBtn.addEventListener('click', ()=>{ gameScreen.classList.add('hidden'); menu.classList.remove('hidden'); });

// menu buttons
document.getElementById('startBtn').onclick = ()=>{ menu.classList.add('hidden'); gameScreen.classList.remove('hidden'); startGame(); };
document.getElementById('settingsBtn').onclick = ()=>{ menu.classList.add('hidden'); settings.classList.remove('hidden'); };
document.getElementById('creditsBtn').onclick = ()=>{ menu.classList.add('hidden'); credits.classList.remove('hidden'); };
document.getElementById('backFromSettings').onclick = ()=>{ settings.classList.add('hidden'); menu.classList.remove('hidden'); };
document.getElementById('backFromCredits').onclick = ()=>{ credits.classList.add('hidden'); menu.classList.remove('hidden'); };

// settings handlers
document.getElementById('bgColor').onchange = e=>{ settingsData.bgColor = e.target.value; applyUI(); localStorage.setItem('dtb_settings', JSON.stringify(settingsData)); };
document.getElementById('playerColor').onchange = e=>{ settingsData.playerColor = e.target.value; localStorage.setItem('dtb_settings', JSON.stringify(settingsData)); };
document.getElementById('enemyShape').onchange = e=>{ settingsData.enemyShape = e.target.value; localStorage.setItem('dtb_settings', JSON.stringify(settingsData)); };

// start/reset game functions
function startGame(){ resetGame(); }
function resetGame(){ 
  player = { x: BASE_W/2 - 20, y: BASE_H - 70, w:40, h:40, speed:6 };
  enemies = []; for(let i=0;i<enemyCount;i++) enemies.push(makeEnemy());
  score=0; highScore = Number(localStorage.getItem('dtb_high')||0);
  gameOver=false; explosionParticles=[]; powerUp=null; shieldActive=false; shieldTimer=0;
  homeBtn.style.display='none'; gameRunning=true;
}
// when game ends
function endGame(){
  gameOver=true; gameRunning=false;
  if(score > highScore){ localStorage.setItem('dtb_high', String(score)); highScore = score; }
  homeBtn.style.display='inline-block';
}

// unlock audio context on user gesture
document.addEventListener('click', function unlockAudio(){
  try{ if(window.audioCtx && window.audioCtx.state === 'suspended') window.audioCtx.resume(); }catch(e){}
  document.removeEventListener('click', unlockAudio);
});

// initial visual setup
applyUI();
</script>
</body>
</html>
